import React from 'react'

class User extends React.Component {
	constructor() {
		super();
	}

	render() {
		return <div>
			<p>имя: {this.props.name}</p>
			<p>фамилия: {this.props.surname}</p>
			
			<button onClick={this.props.showMessage}>
				нажми на меня
			</button>
		</div>;
	}
}

export default User;
